import Navbar from "./navbar";
import { Helmet } from "react-helmet";


export default function MyProject(){
    return(
        <div>
            <Helmet>
                <title>My Projects</title>
            </Helmet>
            <Navbar />
            <h2>Work In Progress</h2>
        </div>
    );
}
